import React, { useState } from "react";
import LineTitle from "../Components/LineTitle"

import LoginForm from "../Components/LoginForm";


function Login() {
  const [isSubmitted, setIsSubmitted] = useState(false);
  const [isDietitian, setIsDietitian] = useState(false);

  const getData = () => {
      let url = 'http://localhost:3001/blogs'; //URL of the resource we want to fetch
      fetch(url).then((response) => response.json()).then((receivedData) => setData(receivedData));
  }

  // Login form
  const renderForm = (
    <LoginForm />
  );

  return (
    <div className="container ">
      <div className="outer ToCenter DarkGreenBox LoginBox BlogBox CurvedContainer">
      <div className="middle">
        <LineTitle Light={true} Title="Login" OnlyLine={false}/>
        {isSubmitted ? <div className="MdFont CursiveFont LightGreenFontShade">{ isDietitian ? "Dietitian successfully logged in" : "User successfully logged in"}</div> : renderForm}
        <LineTitle Light={true} OnlyLine={true}/>
      </div></div>
    </div>
  );
}

export default Login;
